import React, { useState } from "react";
import axios from "axios";

const AddRelationship = () => {
    // State for nodes and relationship
    const [node1Label, setNode1Label] = useState("");
    const [node1Name, setNode1Name] = useState("");
    const [node2Label, setNode2Label] = useState("");
    const [node2Name, setNode2Name] = useState("");
    const [relationshipType, setRelationshipType] = useState("");
    const [customRelationship, setCustomRelationship] = useState("");
    const [response, setResponse] = useState("");

    // Available labels and relationships
    const availableLabels = ["Character", "Ability", "Monster", "MonsterType", "Group", "Sign"];
    const availableRelationships = [
        "AFFILIATED_WITH",
        "BELONGS_TO",
        "FRIEND",
        "HAS_ABILITY",
        "IMMUNE_TO",
        "PARTNER",
        "PART_OF",
        "STEPDAUGHTER_OF",
        "TRAVEL_COMPANION",
        "TYPE_OF",
        "VULNERABLE_TO",
    ];

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const relationship = relationshipType === "Custom" ? customRelationship : relationshipType;
            const res = await axios.post("http://127.0.0.1:8000/add_relationship", {
                node1_label: node1Label,
                node1_properties: { name: node1Name },
                node2_label: node2Label,
                node2_properties: { name: node2Name },
                relationship_type: relationship,
            });
            setResponse(res.data);
        } catch (error) {
            console.error(error);
            setResponse(error.message);
        }
    };

    return (
        <div style={{ textAlign: "center", marginTop: "50px" }}>
            <h2>Add Relationship</h2>
            <form onSubmit={handleSubmit}>
                {/* Node 1 */}
                <div>
                    <label>Node 1 Label:</label>
                    <select
                        value={node1Label}
                        onChange={(e) => setNode1Label(e.target.value)}
                        style={{ margin: "10px", padding: "5px" }}
                    >
                        <option value="" disabled>
                            Choose Label
                        </option>
                        {availableLabels.map((label) => (
                            <option key={label} value={label}>
                                {label}
                            </option>
                        ))}
                    </select>
                    <label>Node 1 Name:</label>
                    <input
                        type="text"
                        value={node1Name}
                        onChange={(e) => setNode1Name(e.target.value)}
                        style={{ margin: "10px", padding: "5px", width: "300px" }}
                    />
                </div>

                {/* Node 2 */}
                <div>
                    <label>Node 2 Label:</label>
                    <select
                        value={node2Label}
                        onChange={(e) => setNode2Label(e.target.value)}
                        style={{ margin: "10px", padding: "5px" }}
                    >
                        <option value="" disabled>
                            Choose Label
                        </option>
                        {availableLabels.map((label) => (
                            <option key={label} value={label}>
                                {label}
                            </option>
                        ))}
                    </select>
                    <label>Node 2 Name:</label>
                    <input
                        type="text"
                        value={node2Name}
                        onChange={(e) => setNode2Name(e.target.value)}
                        style={{ margin: "10px", padding: "5px", width: "300px" }}
                    />
                </div>

                {/* Relationship */}
                <div>
                    <label>Relationship Type:</label>
                    <select
                        value={relationshipType}
                        onChange={(e) => setRelationshipType(e.target.value)}
                        style={{ margin: "10px", padding: "5px" }}
                    >
                        <option value="" disabled>
                            Choose Relationship
                        </option>
                        {availableRelationships.map((rel) => (
                            <option key={rel} value={rel}>
                                {rel}
                            </option>
                        ))}
                        <option value="Custom">Add New Relationship</option>
                    </select>
                </div>

                {/* Custom Relationship Input */}
                {relationshipType === "Custom" && (
                    <div>
                        <label>Custom Relationship Name:</label>
                        <input
                            type="text"
                            value={customRelationship}
                            onChange={(e) => setCustomRelationship(e.target.value)}
                            style={{ margin: "10px", padding: "5px", width: "300px" }}
                        />
                    </div>
                )}

                <button type="submit" disabled={!node1Label || !node2Label || !relationshipType}>
                    Add Relationship
                </button>
            </form>

            {response && (
                <div style={{ marginTop: "20px" }}>
                    <h3>Response:</h3>
                    <pre>{JSON.stringify(response, null, 2)}</pre>
                </div>
            )}
        </div>
    );
};

export default AddRelationship;
